import { BrowserRouter, Routes, Route } from 'react-router-dom';


import './App.css';
import Header from './component/layout/Header';
import Presentacion from './component/layout/Presentacion';
import Footer from './component/layout/Footer'
import yo from './yo.png';




import HomePage from './pages/HomePage';
import ContactPage from './pages/ContactPage';


function App() {
  return (

    <div className="App">

      <Presentacion
       icono2 = {<ion-icon name="radio-button-on-outline"></ion-icon>}

        text=' FULL STACK DEVELOPER'
        icono ={<ion-icon name="radio-button-on-outline"></ion-icon>}
        >
        <img className='img-yo' src={yo} />

      </Presentacion>


      <BrowserRouter >
        <Header />
        <Routes>

          <Route path='/' element={<HomePage />} />
          <Route path='ContactPage' element={<ContactPage />} />

        </Routes>
      </BrowserRouter>

<Footer />
    </div>
  );
}

export default App;
